window.bookSummaryJSON = "<p>A Daring Rescue </p> <p>Emma Paulsen is a geneticist driven by science. But she's also a psychic, so when a dark, good-hearted vampire frees her from the clutches of the evil Kurjans, she realizes he must be the man who's been haunting her dreams. But with a virus threatening vampires' mates, Emma may discover a whole new meaning of \"lovesick\".... </p> <p>A Deadly Decision </p> <p>As King of the Realm, Dage Kayrs has learned to practice diplomacy. Still, it's taken 300 years to find his mate, so he'll stop at nothing to protect her - even if it means turning his back on his own kind.... </p>"; 
